I struggle to understand how to use Sentry in a Go-based lambda.

Here is what Im doing and seeing:
Im initializing Sentry in the main function of binary run in the lambda like so:

`
func main() {
	sentryDSN := os.Getenv("SENTRY_DSN")
	err := sentry.Init(sentry.ClientOptions{
		Dsn:     sentryDSN,
		Release: logger.Version,
		Debug:   true,
	})
	if err != nil {
		panic(fmt.Sprintf("Unable to initialize sentry: %v\n", err))
	}
	log.Printf("Sentry initialized with DSN %s", sentryDSN)
	lambda.Start(handlers.HealthCheckHandler)
}
`
From the log output this seems to work fine.

Then in the handler I am calling `sentry.Flush` like so:

`
func HealthCheckHandler(ctx context.Context) (helpers.Response, error) {
	defer sentry.Flush(2 * time.Second)
	sentry.CaptureMessage("Hello World!!!")
	var buf bytes.Buffer

	body, err := json.Marshal(map[string]interface{}{
		"message": "Success!",
	})
	if err != nil {
		return helpers.Response{StatusCode: http.StatusInternalServerError}, err
	}
	json.HTMLEscape(&buf, body)

	resp := helpers.Response{
		StatusCode:      http.StatusOK,
		IsBase64Encoded: false,
		Body:            buf.String(),
		Headers: map[string]string{
			"Access-Control-Allow-Origin": "*",
			"Content-Type":                "application/json",
		},
	}

	return resp, nil
}
`

The lambda responds withing <200ms if the sentry code is not there. With the sentry code like above it responds in just over 2s and I get `Buffer flushing reached the timeout.` in the Cloudwatch log output.

What am I missing?

